import React, { Component } from 'react'
/*
.eachBox{
    margin-bottom: 25px;
    border: solid black 0.5px;
    background-color: #ff4d4d;
    height: 150px;
    border-radius: 10px;
    margin-right: 20px;
}
*/
export class EachRestaurant extends Component {
    render() {
        return (
            <div style={eachBox}>
                <h2>{this.props.store.name} {this.props.store.rating}</h2>
                <h3>{this.props.store.phone}</h3>
                <h3>{this.props.store.location.address1}</h3>
            </div>
        )
    }
}
const eachBox = {
    //height: '200px',
    marginLeft: '20px',
    marginTop: '35px',
    border: 'solid black 0.5px',
    backgroundColor: '#ff4d4d',
    height: '150px',
    borderRadius: '10px',
    marginRight: '20px',
    fontFamily:'\'Raleway\', sans-serif',
    overflow:'hidden',
}
export default EachRestaurant
